  const [neutral, setNeutral] = useState(0)
  const [schlecht, setSchlecht] = useState(0)

  return (
    <div>
      <h1>give feedback</h1>
      <div>

        <button>neutral</button>
        <button>schlecht</button>
      </div>
      <div>
        <h3>gut: {gut}</h3>
        <h3>neutral: {neutral}</h3>
        <h3>schlecht: {schlecht}</h3>
      </div>
    </div>
  );
}

export default App;
